import { render } from '@testing-library/react';
import React from 'react';
import {Link} from 'react-router-dom'

export default function Vav (){
        return(
            <nav className = "Nav">
            <h3>Logo</h3>
            <ul className ="Nav-List">
            <Link to ="/main"> <li>About</li> </Link>
            
           <Link to ="/"><li>Shop</li> </Link> 
            </ul></nav>
           
        )
    }
